INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('4004148017711', 'Magnésium formule liquide', 'Ingrédients: Mélange de jus de fruits concentrés (37 %) de : eau, ananas, poire, mangue, abricot, extrait de caroube, raisin, citron, pomme. Extrait aqueux de plantes (34%) de : fleur de camomille, fruit de fenouil, écorce d\'orange amère, racine de carotte, feuille d\'épinard. Gluconate de magnésium, miel, citrate de magnésium, arômes naturels. Ne pas utiliser en cas de grossesse ou d\'allaitement. Ne pas utiliser en cas de traitement anti-hypertenseur. Ne pas administrer aux enfants de moins de 12 ans. Cesser l\'utilisation du produit en cas d\'agitation ou de nervosité. Numéro de notification: NUT/PL 66/8 Ingrediënten: Mix uit vruchtenconcentraten (37 %) van: water, ananas, peer, mango, abrikoos, carobe extract, druif, citroen, appel. Waterig plantenextract (34 %) van: kamillebloem, venkelvrucht, sinaasappelschil, wortel, spinazieblad. Magnesiumgluconaat, honing, magnesiumcitraat, natuurlijke aroma\'s. Niet te gebruiken tijdens de zwangerschap of borstvoeding. Niet te gebruiken door personen die behandeld worden voor hypertensie. Niet te gebruiken door kinderen jonger dan 12 jaar. Bij tekenen van onrust of nervosíteit, de inname van het product stoppen. Notificatienummer: NUT/PL 66/8', 'https://static.openfoodfacts.org/images/products/400/414/801/7711/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

